import React from "react";

const NavBarOpen = () => {
  return (
    <div>
      <nav className="Navbar_open">
        <ul className="nav-links-open">
          <li>
            <a href="/">Modelljeink</a>
          </li>
          <li>
            <a href="/">Rólunk</a>
          </li>
          <li>
            <a href="/">Hűségprogram</a>
          </li>
          <li>
            <a href="/">Bejelentkezés</a>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default NavBarOpen;
